import './App.css'
import ReactCute from 'react-cute'
import { Typography } from 'antd'

//* ### Shortcut for console
export const show = console.log()

//* ### Renderers
export const JsonCute = ({ src, ...props }) => <ReactCute src={src} {...props} />
export const TextParagraph = ({ text, ...props }) => <Typography.Paragraph {...props}>{text}</Typography.Paragraph>
export const TextTitle = ({ text, ...props }) => <Typography.Title {...props}>{text}</Typography.Title>
export const ArrayToParagraphs = ({ src, ...props }) => src.map(v => <TextParagraph key={v} text={v} {...props} />)

//* ### Components
export const Booleans = () => {
	const textArray = [
		'var a1 =  true && true;     // t && t возвращает true',
		'var a2 =  true && false;    // t && f возвращает false',
		'var a3 = false && true;     // f && t возвращает false',
		'var a4 = false && (3 == 4); // f && f возвращает false',
		'var a5 = "Cat" && "Dog";    // t && t возвращает Dog',
		'var a6 = false && "Cat";    // f && t возвращает false',
		'var a7 = "Cat" && false;    // t && f возвращает false',
	]

	return (
		<div>
			<TextTitle text='Boolean Logic' />
			<ArrayToParagraphs src={textArray} />
		</div>
	)
}
export const Functions = () => {
	return (
		<div>
			<TextTitle text='Functions' />
		</div>
	)
}

//* ### Application
export const App = () => (
	<div className='App'>
		<Booleans />
		<Functions />
	</div>
)

export default App
